import React, { useState } from 'react';
import axios from 'axios';
 import {getConsultationList}  from "../services/"
import {data} from "./data"










const StaffConsultations = () => {
  const [date, setDate] = useState('');
  const [patientName, setPatientName] = useState('');
  const [healthcareProvider, setHealthcareProvider] = useState('');
  const [consultationType, setConsultationType] = useState('');
  const [medicalCondition, setMedicalCondition] = useState('');
  const [consultations, setConsultations] = useState('');

  const handleFilter = async (e) => {
    e.preventDefault();
    const params = {
      date,
      patientName,
      healthcareProvider,
      consultationType,
      medicalCondition,
    };

  };

  React.useEffect(() => {
    const getUser = JSON.parse(localStorage.getItem("user"))
    const data = {
      officerId : getUser?.id 
    }
  
    const resp= getConsultationList()
    const consultationData = resp.map((item, index) => ({
        id: index + 1,
        date: item.date,
        patientName: item.officerId.name,
        healthcareProvider: item.officerId.healthcareProvider,
        consultationType: item.consultationType,
        medicalCondition: item.medicalCondition,
      }));
    console.log(resp)

    setConsultations(consultationData)
    

        
  }, []);



    const  handleFilterChange = ()=>{

    }

  return (
    <div className="container mx-auto p-4">
      <div className="mt-8">
        <h2 className="text-xl font-bold mb-4"> Officer's  Consultations</h2>
        <th className="py-2 px-4 border-b">Filter Record
                <select  className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white">
                 <option > Patient Name </option>
                 <option > Healthcare Provider </option>
                 <option > Consultation Type </option>
                 <option > Medical Condition </option>
                 <option > Date </option>
                </select>
                

                </th>
        <div className="overflow-x-auto">
        {consultations.length >0 ? ( consultations?.map((consultation, key) => (
          <table className="min-w-full bg-white border border-gray-300">
            <thead>
              <tr>
                <th className="py-2 px-4 border-b">Date</th>
                <th className="py-2 px-4 border-b">Patient</th>
                <th className="py-2 px-4 border-b">Healthcare Provider</th>
                <th className="py-2 px-4 border-b">Consultation Type</th>
                <th className="py-2 px-4 border-b">Medical Condition</th>

              </tr>
            </thead>
            
            <tbody>
              
                <tr key={key}>
                  <td className="py-2 px-4 border-b">{new Date(consultation.date).toLocaleDateString()}</td>
                  <td className="py-2 px-4 border-b">
                    {consultation.patientName}
                  </td>
                  <td className="py-2 px-4 border-b">{consultation.healthcareProvider}</td>
                  <td className="py-2 px-4 border-b">{consultation.consultationType}</td>
                  <td className="py-2 px-4 border-b">{consultation.medicalCondition}</td>
                  <td>  
                  </td>
                </tr>
             
            </tbody>
             
          </table>
          ))):(
            <h1 className=''> You Don't Have Consultation</h1>
        
      )}
        </div>
      </div>
    </div>
  );
};






function FilterData({ data }) {
  const [filters, setFilters] = useState({
    startDate: null,
    endDate: null,
    patientName: '',
    healthcareProvider: '',
    consultationType: '',
    medicalCondition: ''
  });



  const handleFilterChange = (filterName, value) => {
    setFilters(prevFilters => ({
      ...prevFilters,
      [filterName]: value
    }));
  };

  return (
    <div className="container mx-auto py-4">
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <label htmlFor="startDate" className="block mb-1">Start Date:</label>
          <input type="date" id="startDate" className="border border-gray-300 rounded px-2 py-1 w-full" onChange={e => handleFilterChange('startDate', e.target.value)} />
        </div>
        <div>
          <label htmlFor="endDate" className="block mb-1">End Date:</label>
          <input type="date" id="endDate" className="border border-gray-300 rounded px-2 py-1 w-full" onChange={e => handleFilterChange('endDate', e.target.value)} />
        </div>
      </div>
      <div className="mt-4">
        <label htmlFor="patientName" className="block mb-1">Patient Name:</label>
        <input type="text" id="patientName" value={filters.patientName} className="border border-gray-300 rounded px-2 py-1 w-full" onChange={e => handleFilterChange('patientName', e.target.value)} />
      </div>
      {/* Add similar UI elements for other filter criteria */}
      
      {/* Render filtered data */}
      <ul className="mt-4">
        
      </ul>
    </div>
  );
}

